class FindPolymer

  def find_polymer
    input = ''

    chars = input.split('')

    i = 0

    while i < chars.length-1 do
      charA = chars[i]
      charB = chars[i+1]
      if chars_react?(charA, charB)
        chars.slice!(i,2)
        i = i - 2 > 0 ? i - 2 : 0
      else
        i +=1
      end
    end

    puts chars.length
  end

  def chars_react?(charA, charB)
    charA.ord - charB.ord == 32 || charB.ord - charA.ord == 32
  end

  c = FindPolymer.new
  c.find_polymer


end
